import { Routes, Route } from "react-router-dom";
import Home from "./components/Home/Home";
import Game from "./components/Game/Game";


function App() {
  return (
    <div className="App">
        <Routes>
            <Route exact path="/" element={<Game />} />
            <Route exact path="/game" element={<Home />} />
        </Routes>
    </div>
  );

}

export default App;
